import math

"""
1
3
DDK

1
9

"""

def solve(s):
    #print(s, len(s))
    prefixRatio = [0,0]

    response = []

    for prefixStart in range(len(s)):
        if s[prefixStart] == 'D':
            prefixRatio[0] += 1
        else:
            prefixRatio[1] += 1

        
        ctr = 1

        rval = prefixRatio.copy()
        lval = [0,0]
        for iter in range(0, prefixStart):
            if s[iter] == 'D':
                lval[0] += 1
                rval[0] -= 1
            else:
                lval[1] += 1
                rval[1] -= 1
            #print(lval, rval)
            if lval[0]*rval[1] == lval[1]*rval[0]:
                #print("!")
                ctr += 1

        response.append(ctr)

    return " ".join(map(str,response))
    
if __name__ == "__main__":

    t = int(input())
    for test in range(1, t + 1):
        _ = input()
        s = input()
        print(f"{solve(s)}")
